import { Link } from 'react-router-dom';
import './home.css';

function Home() {
  return (
    <div className='nav-container'>
      <div className='home-menu'>
        <ul className='nav-menu'>
          <li>Home</li>
          <li>Products</li>
          <li>Albums</li>
          <li>About Us</li>
          <li>Contract</li>
        </ul>
      <div>
        <h1>Welcome to Fashion Blog</h1>
      </div>
      </div>
    </div>
  );
}

export default Home;
